var title_f35_46_36578="Inspiratory effort triggering";
var content_f35_46_36578=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F76380&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F76380&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Inspiratory effort and triggering of ventilator",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 423px; height: 344px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Recordings of tidal volume, flow, airway pressure (P",
"    <sub>",
"     aw",
"    </sub>",
"    ) and esophageal pressure (P",
"    <sub>",
"     es",
"    </sub>",
"    ) in a patient with chronic obstructive pulmonary disease receiving pressure support ventilation. Approximately one-half of the patient's inspiratory efforts do not succeed in triggering the ventilator. Triggering occurred only when the patient generated a Pes &lt; -8 cmH",
"    <sub>",
"     2",
"    </sub>",
"    O which was equal in magnitude to the opposing elastic recoil pressure.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Tobin, MJ, Jubran, A, Schwiez Med Wochenschr 1994; 124:2139",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
