"     <a class=\"medical medical_review\" href=\"mobipreview.htm?18/2/18469?source=related_link\">",
"      Diagnosis, treatment, and prevention of Bartonella infections in HIV-infected patients",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?31/5/31830?source=related_link\">",
"      Endocarditis caused by Bartonella",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?7/63/8182?source=related_link\">",
"      Epidemiology and clinical manifestations of Bartonella infections in HIV-infected patients",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?22/47/23289?source=related_link\">",
"      Microbiology, epidemiology, clinical manifestations, and diagnosis of cat scratch disease",
"     </a>",
"    </li>",
"   </ul>",
