var title_f35_46_36587="Characteristic grief depres";
var content_f35_46_36587=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F53062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F53062&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Characteristics of grief versus depression",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Grief",
"       </td>",
"       <td class=\"subtitle1\">",
"        Depression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Definition",
"       </td>",
"       <td>",
"        Feelings and behaviors that result from a particular loss",
"       </td>",
"       <td>",
"        Depressed mood, decreased interest and pleasure, appetite and sleep disturbance, psychomotor agitation or retardation, decreased concentration, loss of energy, feelings of worthlessness, guilt, hopelessness, helplessness, and thoughts of death with impairment of functioning lasting at least two weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Symptoms and signs",
"       </td>",
"       <td rowspan=\"2\">",
"        Somatic distress, sleep and appetite disturbance, diminished concentration, social withdrawal, sighing",
"       </td>",
"       <td>",
"        Hopelessness, helplessness, anhedonia, worthlessness, guilt, suicidal ideation most useful diagnostic clues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Somatic distress, sleep and appetite disturbance, diminished concentration, social withdrawal, sighing are also common",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"4\">",
"        Other differentiating factors",
"       </td>",
"       <td>",
"        Patient retains capacity for pleasure",
"       </td>",
"       <td>",
"        Nothing is enjoyable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Comes in waves",
"       </td>",
"       <td>",
"        Constant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Passive wishes for death",
"       </td>",
"       <td>",
"        Intense, persistent suicidal thoughts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Able to look forward to the future",
"       </td>",
"       <td>",
"        No sense of anything to look forward to",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Block, SD. Psychological issues in end of life care. Journal of Palliative Medicine 2006; 9:751. Copyright &copy;2006 Mary Ann Liebert, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
