var title_f35_46_36591="Mitral valvuloplasty using the Inoue balloon catheter";
var content_f35_46_36591=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1195px;\">",
"  <div class=\"videoplayer\" h264=\"./images/CARD/75997/mitrvlvp_conv.mp4?title=Mitral+valvuloplasty+using+the+Inoue+balloon+catheter\" style=\"width:224px;height:272px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 625px\">",
"   <div class=\"ttl\">",
"    Mitral valvuloplasty using the Inoue balloon catheter",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 605px; height: 230px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This is a balloon inflation-deflation sequence during a percutanous mitral commissurotomy using the Inoue balloon. The balloon catheter has been introduced from the right femoral vein, crosses the interatrial septum after a transeptal catheterization, and has been manipulated across the mitral valve into the left ventricle with the balloon deflated. During inflation the distal portion of the balloon expands first and the catheter is pulled back slightly with resistance being felt from the stenotic valve. Additional inflation then expands the rear or proximal portion of the balloon, thus locking the balloon within the stenotic valve. The final inflation expands the mid-portion resulting in a controlled transmission of force resulting in a splitting of the fused commissures. The rapid inflation-deflation sequence shown here results in no important period of hypotension; most patients have little awareness of the inflation. The other catheters seen in the image are a pigtail catheter in the left ventricle and a pulmonary artery thermodilution cardiac output catheter.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of John D Carroll, MD. This type of movie will be part of The Multimedia Textbook of Coronary Arteriography and Interventions, Williams &amp; Wilkins, Baltimore, Fall, 1996.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
